import React from "react";

export const Headers = () => {
  return (
    <div className="flex w-100">
      <h1 className="m-2 max-w-lg text-2xl font-bold text-center md:text-4xl md:text-left sm:m-10 ">
        The Logo
      </h1>
      <div className="bg-[#DDE8FE] items-center text-center w-3/8 rounded-b-lg h-30 absolute right-20 h-32">
        <ul className="list-none  m-20 gap-12 list-inside flex decoration-none">
          <li className="underline">HOME</li>
          <li>PLACEMENT STATISTICS</li>
          <li>CONTACT US</li>
          <button className="bg-transparent hover:bg-blue-500 text-blue-700 font-semibold hover:text-white px-4 border border-blue-500 hover:border-transparent rounded">RESUME BUILDER</button>
        </ul>
      </div>
    </div>
  );
};
